    "title": "enforcerprofilemappingpolicy",
    "version": "1.0"
  },
  "paths": {
    "/enforcerprofilemappingpolicies": {
      "get": {
        "description": "Retrieves the list of enforcer profile mappings.",
        "operationId": "get-all-enforcerprofilemappingpolicies",
        "parameters": [
          {
            "description": "Also retrieve the objects that propagate down.",
            "in": "query",
            "name": "propagated",
            "schema": {
              "type": "boolean"
            }
          },
          {
            "description": "Filtering query. Consequent `q` parameters will form an or.",
            "example": "associatedTags contains ['$name=hello'] or type == 'Docker'",
            "in": "query",
            "name": "q",
            "schema": {
              "type": "string"
            }
          }
        ],
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "items": {
                    "$ref": "#/components/schemas/enforcerprofilemappingpolicy"
                  },
                  "type": "array"
                }
              }
            },
            "description": "n/a"
          }
        },
        "tags": [
          "policy/enforcerconfig",
          "squall"
        ]
      },
      "post": {
        "description": "Creates a new enforcer profile mappings.",
        "operationId": "create-a-new-enforcerprofilemappingpolicy",
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "$ref": "#/components/schemas/enforcerprofilemappingpolicy"
              }
            }
          }
        },
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/enforcerprofilemappingpolicy"
                }
              }
            },
            "description": "n/a"
          }
        },
        "tags": [
          "policy/enforcerconfig",
          "squall"
        ]
      }
    },
    "/enforcerprofilemappingpolicies/{id}": {
      "delete": {
        "description": "Deletes the mapping with the given ID.",
        "operationId": "delete-enforcerprofilemappingpolicy-by-ID",
        "parameters": [
          {
            "description": "Filtering query. Consequent `q` parameters will form an or.",
            "example": "associatedTags contains ['$name=hello'] or type == 'Docker'",
            "in": "query",
            "name": "q",
            "schema": {
              "type": "string"
            }
          }
        ],
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/enforcerprofilemappingpolicy"
                }
              }
            },
            "description": "n/a"
          }
        },
        "tags": [
          "policy/enforcerconfig",
          "squall"
        ]
      },
      "get": {
        "description": "Retrieves the mapping with the given ID.",
        "operationId": "get-enforcerprofilemappingpolicy-by-ID",
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/enforcerprofilemappingpolicy"
                }
              }
            },
            "description": "n/a"
          }
        },
        "tags": [
          "policy/enforcerconfig",
          "squall"
        ]
      },
      "parameters": [
        {
          "in": "path",
          "name": "id",
          "required": true,
          "schema": {
            "type": "string"
          }
        }
      ],
      "put": {
        "description": "Updates the mapping with the given ID.",
        "operationId": "update-enforcerprofilemappingpolicy-by-ID",
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "$ref": "#/components/schemas/enforcerprofilemappingpolicy"
              }
            }
          }
        },
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/enforcerprofilemappingpolicy"
                }
              }
            },
            "description": "n/a"
          }
        },
        "tags": [
          "policy/enforcerconfig",
          "squall"
        ]
      }
    },
    "/enforcerprofilemappingpolicies/{id}/enforcerprofiles": {
      "get": {
        "description": "Returns the list of enforcer profiles that an enforcer profile mapping\nmatches.",
        "operationId": "get-all-enforcerprofiles-for-a-given-enforcerprofilemappingpolicy",
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "items": {
                    "$ref": "./enforcerprofile#/components/schemas/enforcerprofile"
                  },
                  "type": "array"
                }
              }
            },
            "description": "n/a"
          }
        },
        "tags": [
          "policy/enforcerconfig",
          "squall"
        ]
      },
      "parameters": [
        {
          "in": "path",
          "name": "id",
          "required": true,
          "schema": {
            "type": "string"
          }
        }
      ]
    },
    "/enforcerprofilemappingpolicies/{id}/enforcers": {
      "get": {
        "description": "Returns the list of enforcers affected by an enforcer profile mapping.",
        "operationId": "get-all-enforcers-for-a-given-enforcerprofilemappingpolicy",
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "items": {
                    "$ref": "./enforcer#/components/schemas/enforcer"
                  },
                  "type": "array"
                }
              }
            },
            "description": "n/a"
          }
        },
        "tags": [
          "core/enforcer",
          "squall"
        ]
      },
      "parameters": [
        {
          "in": "path",
          "name": "id",
          "required": true,
          "schema": {
            "type": "string"
          }
        }
      ]
    }
  },
  "tags": [
